import React from "react";
import logo from "../img/logoRG.png"
function Menu() {
    return(
        <nav className="navbar navbar-expand-sm bg-dark navbar-dark">
            <div className="container-fluid h-10">
                <img className="img-fluid" style={{height:"80"}} src={logo}/>
            </div>
        </nav>
    );
}
export default Menu;
